operators_and_groups_note.cn:
{{operators(密探)}}
作业必需的密探。
密探练度（等级、模组）仅供参考，MAA 的自动编队仅支持技能选择，其余信息暂未支持。

{{groups(密探组)}}
一系列可替换密探的编组。
组内密探可以任选其一，MAA 自动编队时按最高练度来选择。

operators_and_groups_note.zh_tw:
{{operators(密探)}}
作業必需的密探。
密探練度（等級、模組）僅供參考，MAA 的自動編隊僅支持技能選擇，其餘信息暫未支持。

{{groups(密探組)}}
一系列可替換密探的編組。
組內密探可以任選其一，MAA 自動編隊時按最高練度來選擇。
